import axios from 'axios'
import { showRenewHistory } from '../actions/actions'

class GetRequest {
  static getHistory() {
    console.log('....рабоотаю')
    return () => {
      axios.get('/his').then((response) => response.data)
    }
  }
}

export default GetRequest
